import React from 'react';
import './card-info-style.scss';


const Cardata = (dtata, type,header)=>(

    <section className="card">
        <h1 className="card-header">Global Numbers</h1>
        <span className="card-num blue">251,242</span>
        <span className="card-text">Cases</span>
        <span className="card-num green">25161</span>
        <span className="card-text">Healed</span>
        <span className="card-num red">213</span>
        <span className="card-text">Deaths</span>
    </section>
)
export default Cardata;
